// src/App.js
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";
import Sidebar from "./components/Sidebar";
import ProtectedRoute from "./components/ProtectedRoute";

// Superadmin pages
import SuperAdminDashboard from "./pages/SuperAdmin/Dashboard.js";
import Schools from "./pages/SuperAdmin/Schools.js";
import SchoolAdmins from "./pages/SuperAdmin/SchoolAdmins.js";
import ManageDrivers from "./pages/SuperAdmin/ManageDrivers";

// Schooladmin pages
import SchoolDashboard from "./pages/SchoolAdmin/Dashboard";
import Drivers from "./pages/SchoolAdmin/Drivers";
import Stops from "./pages/SchoolAdmin/Stops";

function App() {
  return (
    <BrowserRouter>
      <div className="flex">
        {localStorage.getItem("token") && <Sidebar />}
        <div className="flex-1 p-4">
          <Routes>
            {/* Login */}
            <Route path="/" element={<Login />} />

            {/* Superadmin */}
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute allowedRoles={["superadmin"]}>
                  <SuperAdminDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/schools"
              element={
                <ProtectedRoute allowedRoles={["superadmin"]}>
                  <Schools />
                </ProtectedRoute>
              }
            />
            <Route
  path="/drivers/all"
  element={
    <ProtectedRoute allowedRoles={["superadmin"]}>
      <ManageDrivers />
    </ProtectedRoute>
  }
/>
            <Route
              path="/schooladmins"
              element={
                <ProtectedRoute allowedRoles={["superadmin"]}>
                  <SchoolAdmins />
                </ProtectedRoute>
              }
            />

            {/* Schooladmin */}
            <Route
              path="/school-dashboard"
              element={
                <ProtectedRoute allowedRoles={["schooladmin"]}>
                  <SchoolDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/drivers"
              element={
                <ProtectedRoute allowedRoles={["schooladmin"]}>
                  <Drivers />
                </ProtectedRoute>
              }
            />
            <Route
              path="/stops/school"
              element={
                <ProtectedRoute allowedRoles={["schooladmin"]}>
                  <Stops />
                </ProtectedRoute>
              }
            />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
